  input: 'TEXT,F3XA,,"The Arizona Democratic Party is reciept of the Commissions request
    for additional information dated 7-28-2006.  Please note that the Committee''s
    established procedure for obtaining Best Efforts is as follows:  1) Original solicitations
    for fundraising receptions or direct mail solicitation for funds include contribution
    cards that clearly request and explain that federal law requires us to request
    and report the required information.  2) At the reception when checks are received,
    contributors are asked to fill out contribution cards if they haven''t already
    that requests and explains that federal law requires us to request and report
    the required information.  3) Arizona fundraising staff then follow up on contributions
    that are in excess of $200 by phone prior to the filing of each monthly report
    with a list provided by the Compliance Department and information obtained is
    reported on that report. 4) Finally, every 30 days the Compliance Department sends
    a letter which includes a pre-addressed, stamped return envelope and forms that
    clearly asks for the missing information.  If information is provided after the
    reporting period and the contributor will not appear on the next regularly scheduled
    report; amendments to the report originally disclosing the contribution will be
